import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { getcatsFetch } from '../features/DemoSlice';

export default function History() {
  const { cats, isloading, error } = useSelector((state) => state.demo); // Accessing state.demo directly
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getcatsFetch());
  }, [dispatch]);


  if (isloading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  console.log(cats); 

  return (
    <div>
      <h1>Cat Breeds History</h1>
      {cats.length > 0 ? (
        <ul>
          {cats.map((cat, index) => (
            <li key={index}>{cat.name}</li> // Displaying the cat breed names
          ))}
        </ul>
      ) : (
        <p>No cat breeds available.</p>
      )}
    </div>
  );
}
